const layoutStyle = {
  margin: 20,
  padding: 20,
  // border: '1px solid #DDD',
  // color: 'red'
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    <ul className="cb-slideshow">
    </ul>
    {props.children}
  </div>
);

export default Layout;
